}

#extensions_settings .inline-drawer-toggle.inline-drawer-header, 
#extensions_settings2 .inline-drawer-toggle.inline-drawer-header, 
#user-settings-block h4, 
.standoutHeader {
  position: relative;
  background: url(https://files.catbox.moe/yf0jie.jpg) no-repeat center/cover;
  padding: 5px 5px 5px 20px;
  margin: 20px 2px;
  text-align: center;
  border: none;
  box-shadow: 1px 1px;
}

.title_restorable span,
strong span,
#extensions_settings .inline-drawer-toggle.inline-drawer-header b,
#extensions_settings2 .inline-drawer-toggle.inline-drawer-header b,
.inline-drawer strong,
.standoutHeader.inline-drawer-header b {
  margin: 0 auto;
}

#extensions_settings .inline-drawer-toggle.inline-drawer-header::before, #extensions_settings2 .inline-drawer-toggle.inline-drawer-header::before, 
#user-settings-block h4::before, 
.standoutHeader::before {
  content: "";
  position: absolute;
  left: -7px;
  top: -14px;
  width: 100px;
  height: 50px;
  background: url(https://files.catbox.moe/f4oh8j.png) no-repeat center/contain;
}

.drawer-content select,
.inline-drawer-header {
  background: url(https://files.catbox.moe/f0lxp5.jpg) no-repeat center/cover;
  border: 1px solid #7F4A56;
}

.neo-range-input,
.range-block-counter input,
.text_pole:not(#customCSS) {
   border: 1px solid #7F4A56;
   border-top: none;
   background: url(https://files.catbox.moe/nn7yb0.jpg) no-repeat top/cover;
}

input[type="range"] {
  border-radius: 6px!important;
  background: linear-gradient(to right,#76c893,#4a7c59,#c6f8b2)!important;
  background-blend-mode: overlay;
  box-shadow: none!important;
  outline: none;
}

input[type="range"]::-webkit-slider-thumb {
    position: relative;
    height: 25px; 
    width: 25px; 
    box-shadow: none;
    background: transparent url(https://files.catbox.moe/67huqv.png) no-repeat center/contain;
}

.menu_button{
  background: url(https://files.catbox.moe/b3pp23.jpg) no-repeat center/cover;
  border: none;
  box-shadow: 2px 2px;
  filter: none;
}

hr,
#completion_prompt_manager .completion_prompt_manager_list_separator hr {
   width: 100%;
   height: 20px;
   background: url(https://files.catbox.moe/915rsu.png) no-repeat center/contain;
   opacity: 1;
}

::-webkit-scrollbar {
  width: 10px !important;
  height: 10px !important;
  background: transparent !important;
}

::-webkit-scrollbar-thumb {
  background-color: #E8F0E8!important;
  border: none;
  box-shadow: none!important;
  border-radius: 1px !important;
}

input[type='checkbox'] {
  width: 14px;
  height: 14px;
  cursor: pointer;
  outline: none;
  background: rgb(0,0,0,0.2);
  border: none;
}

input[type='checkbox']:checked {
  background: transparent;
}

input[type='checkbox']:checked::after {
  content: "‚ùáÔ∏è";
  position: absolute;
  font-size: 12px;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  color: white;
}

h3 {
   display: inline-block;
   padding-left: 30px;
   position: relative;
}

h3::before {
   content: "";
   position: absolute;
   top: -5px;
   left: 0;
   width: 30px;
   height: 30px;
   background: url(https://files.catbox.moe/oj11oo.png) no-repeat center/contain;
}

.popup {
   background: #d2e2bb;
   border: none;
}

