/* ===ËÅäÂ§©ÁïåÈù¢=== */
#chat {
   background: transparent;
}

body.bubblechat .mes,
body.bubblechat .mes[is_user="true"] {
   flex-direction: column;
   align-items: center;
   border: 8px solid transparent;
   border-image: url(https://files.catbox.moe/5hghx4.jpg) 30 stretch;
   background: transparent;
   margin: 50px 0;
}

.last_mes .mesAvatarWrapper {
   padding-bottom: 0!important;
}

.mes_text {
  padding: 10px;
  border-radius: 12px;
  background: rgba(255,255,255,0.5);
}

.mesAvatarWrapper {
    display: flex;
    flex-direction: row;
    align-items: center!important;
    width: 102%;
    height: 60px;
    transform: translateY(-45px)!important;
    background: url(https://files.catbox.moe/j4ym3e.png) no-repeat center/contain;
}


.mes[is_user='false'] .mes_block {
   padding: 5px;
   border-radius: 12px;
   background: url(https://files.catbox.moe/avg5yu.jpg) no-repeat top/cover;
}

.mes[is_user='true'] .mes_block {
   padding: 0 5px;
   border-radius: 12px;
   background: url(https://files.catbox.moe/e5pnh3.jpg) no-repeat top/cover;
}

.mes_button.mes_edit::before,
.mes_button.extraMesButtonsHint::before {
   display: none;
}

.mes_button.mes_edit,
.mes_button.extraMesButtonsHint {
   width: 30px;
   height: 30px;
   opacity: 1;
   filter: none !important;
}

.mes_button.mes_edit {
   background: url(https://files.catbox.moe/o7k0oy.png) no-repeat center/contain;
}

.mes_button.extraMesButtonsHint {
   background: url(https://files.catbox.moe/mjy928.png) no-repeat center/contain;
}

.mes .mes_timer, .mes .mesIDDisplay, .mes .tokenCounterDisplay {
   margin-right: 2px;
}

.swipe_left {
    bottom: 15px;
    left: 8px;
}

.mes[is_user='true'] .mesAvatarWrapper .avatar::before,
.mes[is_user='false'] .mesAvatarWrapper .avatar::before {
   content: "";
   position: absolute;
   top: 0;
   left: -5px;
   width: 60px;
   height: 60px;
   background: url(https://files.catbox.moe/r3hjzq.png) no-repeat center/contain;
   transform: scale(1.2);
}

/* ===ËÅäÂ§©ÊñáÊú¨=== */
q {
   display: inline-block;
   position: relative;
   border-bottom: 4px double green;
   background: white;
   border-radius: 6px;
}

q::before {
   content: "";
   position: absolute;
   top: -10px;
   right: -6px;
   width: 30px;
   height: 30px;
   background: url(https://files.catbox.moe/w98zsq.png) no-repeat center/contain; 
}

#chat .mes_block .mes_text :not(pre code) > em,
#chat .mes_block .mes_text i:not(pre code i):not(i[class*="fa-"]) {
   display: inline-block;
   border-left: 4px double green;
   border-right: 4px double green;
   border-radius: 6px;
   background: linear-gradient(135deg, #a8e6cf, #dcedc1, #a5d6a7);
}

.mes_text pre code {
